To find the radius of the circle with equation $x^2 + 8x + y^2 - 6y = 0$, we complete the square for both $x$ and $y$.

For $x^2 + 8x$, we add and subtract $(8/2)^2 = 16$:
\begin{align*}
x^2 + 8x + 16 &= (x + 4)^2 - 16.
\end{align*}
For $y^2 - 6y$, we add and subtract $(-6/2)^2 = 9$:
\begin{align*}
y^2 - 6y + 9 &= (y - 3)^2 - 9.
\end{align*}
Substitute these expressions into the circle's equation:
\begin{align*}
(x + 4)^2 - 16 + (y - 3)^2 - 9 &= 0,\\
(x + 4)^2 + (y - 3)^2 &= 25.
\end{align*}
We see that the equation is that of a circle centered at $(-4,3)$ with radius $\boxed{5}$.

