We can start by solving the system of equations:
\[
\begin{cases}
6x + 4y = 7 \\
Kx + 8y = 7
\end{cases}
\]

To eliminate $y$, we can multiply the first equation by 2 and the second equation by $-1$:

\[
\begin{cases}
12x + 8y = 14 \\
-Kx - 8y = -7
\end{cases}
\]

Adding the two equations together gives:
\begin{align*}
12x + 8y - Kx - 8y &= 14 - 7 \\
(12-K)x &= 7 \\
x &= \frac{7}{12-K}
\end{align*}

If there is no pair of real numbers $(x,y)$ that satisfies the system, then the denominator must equal zero, implying $12-K \neq 0 \Rightarrow K \neq 12$. Hence, the value of $K$ is $\boxed{12}$.

