To solve for $x$ in the equation $\frac{\sqrt{2x}}{\sqrt{3x-1}}=\frac{3}{2}$, we first square both sides to eliminate the square roots. 

\begin{align*}
\frac{\sqrt{2x}}{\sqrt{3x-1}} &= \frac{3}{2} \\
\left(\frac{\sqrt{2x}}{\sqrt{3x-1}}\right)^2 &= \left(\frac{3}{2}\right)^2 \\
\frac{2x}{3x-1} &= \frac{9}{4}
\end{align*}

Cross multiply and solve for $x$:

\begin{align*}
2x \cdot 4 &= 9 \cdot (3x-1) \\
8x &= 27x - 9 \\
27x - 8x &= 9 \\
19x &= 9 \\
x &= \frac{9}{19}
\end{align*}

Thus, the solution to the equation is $\boxed{\frac{9}{19}}$.

solution:
To perform division in complex numbers, we multiply both the numerator and the denominator by the conjugate of the denominator. In this case, the conjugate of $1+2i$ is $1-2i$. Multiplying: \begin{align*}
\frac{-3+4i}{1+2i}&=\frac{(-3+4i)(1-2i)}{(1+2i)(1-2i)}\\
&=\frac{-3+4i+6i-8i^2}{1+2i-2i-4i^2}\\
&=\frac{5+10i}{5}\\
&=\boxed{1+2i}
\end{align*}

Let the number of clowns in the parade be $c$ and the number of horses be $h$. We are looking for the value of $h$. Assuming that each clown has 2 legs and 1 head, and that each horse has 4 legs and 1 head, we can set up the following system of equations:

\begin{align*}
2c+4h &= 30 \\
c + h &= 10 \\
\end{align*}

To solve for $h$, we need to eliminate $c$ from the equations above. We can rewrite the second equation above as $c=10-h$, and substituting this into the first equation to eliminate $c$ gives $2(10-h)+4h = 30$, or $h=5$. Thus, there are $\boxed{5}$ horses in the parade.

