-2 & -3 & 9
\end{pmatrix}^{-1}
=
\frac{1}{{(3)(-3)-(4)(-2)}}
\begin{pmatrix}
-3 & -4 & 12 \\
2 & 3 & -9
\end{pmatrix}
=
\begin{pmatrix}
\frac{-3}{-18} & \frac{-4}{-18} & \frac{12}{-18} \\
\frac{2}{-18} & \frac{3}{-18} & \frac{-9}{-18}
\end{pmatrix}
