\frac{1}{6} & \frac{2}{9} & -\frac{2}{3} \\
-\frac{1}{3} & -\frac{1}{6} & \frac{1}{2}
\end{pmatrix}
\]

Now, we can multiply the inverse by the column matrix on the right side to find the values of $x, y, z$:
\[
\begin{pmatrix}
\frac{1}{6} & \frac{2}{9} & -\frac{2}{3} \\
-\frac{1}{3} & -\frac{1}{6} & \frac{1}{2}
\end{pmatrix}
\begin{pmatrix}
10 \\
-4
\end{pmatrix}
=
\begin{pmatrix}
10 \cdot \frac{1}{6} + (-4) \cdot \frac{2}{9} \\
10 \cdot (-\frac{1}{3}) + (-4) \cdot (-\frac{1}{6})
\end{pmatrix}
=
\begin{pmatrix}
