Let $n$ be the smaller of the two consecutive integers. Then, the other integer is $n+1$. The product of these two integers is $n(n+1)$. We are looking for the smallest positive four-digit integer that can be expressed in this form.

To find the smallest positive four-digit integer, we need to find the smallest value of $n$ such that $n(n+1) \geq 1000$. We have:
\begin{align*}
n(n+1) &\geq 1000 \\
n^2+n &\geq 1000 \\
n^2+n-1000 &\geq 0
\end{align*} 
Now, we solve this quadratic inequality by factoring:
\begin{align*}
(n+25)(n-40) &\geq 0
\end{align*} 
For this inequality to be true, either both factors are nonnegative or both factors are nonpositive. Therefore, $n \geq 40$ or $n \leq -25$. Since $n$ is a positive integer, the smallest value for $n$ that satisfies the inequality is $n = \boxed{40}$. Thus, the smallest positive four-digit integer that is the product of two consecutive integers is $40 \times 41 = 1640$.

